{"operationName":"blocks","variables":{"timestampFrom":1672346280,"timestampTo":1672346880},"query":"query blocks($timestampFrom: Int!, $timestampTo: Int!) {
  blocks(
    first: 1
    orderBy: timestamp
    orderDirection: asc
    where: {timestamp_gt: $timestampFrom, timestamp_lt: $timestampTo}
  ) {
    id
    number
    timestamp
  }
}
"}

